import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import * as serviceWorker from "./serviceWorker";

function MyApp() {
  return (
    <div>
      <a>Hello</a>
    </div>
  );
}
ReactDOM.render(<MyApp />, document.getElementById("root"));

serviceWorker.unregister();
